//         <Route>
//             CheckCookie() &&
//             <Route exact path=
//               {"/frontpage"} component={Frontpage} />
//         </Route>
//       </BrowserRouter >
//     )
//   }
// }

export default class CustomRoute extends Component {
  render() {
    return (
      <Router>
        <Switch>
          {
            CheckCookie ?
              <Route exact path=
                {"/frontpage"} component={Frontpage} /> :
              <Route exact  path=
                {"/"} component={Login} />
          }
        </Switch>
      </Router>
    )
  }
}
